export const SET_DATA = '[dataSet]SET_DATA';
export const setData = data => dispatch => {
    dispatch(setDisplayData(data));
    dispatch(setSymbolList(data));
};

export const SET_DISPLAYDATA = '[dataSet]SET_DATA';
export const setDisplayData = data => dispatch => {
    dispatch(_addNotificationAction(action));
    displayNotification(action);
};
